import React from "react";
import Card from "../components/Card";
import "../css/Home.css";
const Home = ({data}) => {
  return (
    <div className="home">
      <h1>NewsList</h1>
      <ul>
        {
          data.map((val,index)=>{
            <li key={index}></li>
          })
        }
      </ul>

    </div>
  );
};

export default Home;
